import { Form, Input, Button } from 'antd';
import React from 'react';
import * as actions from '../store/actions/auth'

class RegisterForm extends React.Component {

    onFinish = values => {
        console.log(values);
      };
    render() {
      return (
        <Form name="nest-messages" onFinish={this.onFinish}>
          <Form.Item
            name= "username"
            label="Username"
            rules={[
              {
                required: true,
              },
            ]}
          >
            <Input />
          </Form.Item>
          <Form.Item
            name= "password1"
            label="Password"
            rules={[
              {
                required:true
              },
            ]}
          >
            <Input />
          </Form.Item>

          <Form.Item
            name= "password2"
            label="Password again"
            rules={[
              {
                required:true
              },
            ]}
          >
            <Input />
          </Form.Item>

          <Form.Item>
            <Button type="primary" htmlType="submit">
              Submit
            </Button>
          </Form.Item>
        </Form>
      );
    };

}

const mapStateToProps = (state) => {
    return {
        loading: state.loading,
        error: state.error
    }
}

const mapDispatchToProps = dispatch => {
    return {
        onAuth: (username, password1, password2) => {
            dispatch(actions.authSignup(username,password))
        }
    }
}

export default RegisterForm
